import Link from 'next/link';

const Navbar = () => (

    <nav className="main-navbar">
        <ul className="navbar-menu">
            <li>IMDB logo</li>
            <li>Search </li>
            <li>Sign in</li>
        </ul>
    </nav>

);

export default Navbar;
